import React,{useEffect, useState} from 'react'
import axios from 'axios'
import { useParams } from 'react-router-dom'

const EditMenu = () =>{
    const [Menu,setMenu]=useState(Object)
    const url="http://192.168.1.4:8080/menus/get"
    const parametros=useParams()
    async function peticiongetMenu(){
        const respuesta=await axios.get(url+"?NombreMenu="+parametros.nombreMenu)
        console.log(respuesta.data)
        setMenu(respuesta.data)
    }
    useEffect(()=>{
        peticiongetMenu();
    },[]);


    return (
    <div>
        {Menu.nombreMenu} : {Menu.tipoMenu} : {Menu.precio}
    </div>
    )
}

export default EditMenu
